import React from "react";
import { useEffect } from "react";
import { Button } from "./component/Component";

function Dashboard() {
    useEffect(() => {
        if (localStorage.getItem("isLogin") !== "true") {
            window.location.href = "/";
        }
    }, []);
    const logot = () => {
        localStorage.setItem("isLogin", "false");
        localStorage.setItem();
    }
    return(
        <div className="w-full h-screen flex justify-center items-center bg-gray-300">
            <div className="bg-white lg:w-1/2 sm:w-full rounded-2xl p-8 flex flex-col">
                <div className="flex flex-col">
                    <div className="flex justify-center">
                        <Button onClick={logot} color="red-500" textColor="white" text="logot"/>
                    </div>
                    <div className="flex flex-col">
                        <h1 className="lg:text-2xl sm:text-md text-green-600 font-bold text-center">Dashboard</h1>
                    </div>
                </div>
            </div>
        </div>
    )
}
export default Dashboard;
